import React from "react";

const Logo = () => {
  return (
    <a href="/" style={{ display: "flex" }}>
      <img
        style={{ height: "15px" }}
        src="https://www.instagram.com/static/images/web/logged_out_wordmark-2x.png/d2529dbef8ed.png"
        alt="logo"
      />
    </a>
  );
};

export default Logo;
